import React from 'react';
import { StyleSheet, Button, View, SafeAreaView, Text, Separator } from 'react-native';


const App = () => (
  <View style={styles.container}>
      <View style={styles.buttonStyle}>
          <Button
          title= 'Button 1'
          color= 'blanchedalmond'
          fontWeight = 'bold'
          titleColor = 'black'
          />
      </View>
      <View style={styles.buttonStyle}>
          <Button
          color= 'blanchedalmond'
          fontWeight = 'bold'
          textColor = 'black'
          >
          <Text style={{color: 'black'}}>Button 1</Text>
          </Button>
      </View>

  </View>
)

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: 'column',
    height: '200px',
    justifyContent: 'center',
    marginTop: '30%',
    marginBottom: '30%',
    marginLeft: '10%',
    marginRight: '10%'
},
buttonStyle: {
    paddingBottom: '10px',
}
});

export default App;
